import React, {useState} from 'react';
import './App.css';

function App() {
  const [todos, setTodos] = useState([
    {
      text:"Learn ReactHooks",
      isCompleted: false
    },
    {
      text:"Go get boba",
      isCompleted: false
    },
    {
      text:"play basketball",
      isCompleted: false
    }
  ])

  return (
    <div className="app">
      <div className="todo-list">
        {todos.map( todo, index => {
          <Todo key={index} index={index}/>
        })}
      </div>
    </div>
  )
}

export default App;
